import React from 'react';

const Conclusion: React.FC = () => {
  return (
    <div className="mt-12 bg-gradient-to-r from-blue-600 to-indigo-600 rounded-2xl shadow-xl p-8 text-white">
      <h2 className="text-2xl font-bold mb-4">Kết luận</h2>
      <p className="text-blue-100 leading-relaxed">
        Các sửa đổi gần đây của Luật SHTT năm 2022 và việc ban hành Nghị định số 65/2023/NĐ-CP đánh dấu một bước tiến quan trọng trong việc tăng cường bảo vệ SHTT tại Việt Nam, đáp ứng các tiêu chuẩn và đòi hỏi cao hơn từ các thỏa thuận quốc tế như CPTPP, EVFTA, RCEP, và Thỏa ước La-hay. Những quy định này đã được thiết lập một cách chi tiết và cung cấp hướng dẫn rõ ràng cho các chủ thể liên quan.
      </p>
    </div>
  );
};

export default Conclusion;
